measurements.description:
Eleven full round flowers on one 76-cm inflorescence;
	sepals and petals white, blushed burgundy, burgundy speckles striated longitudinally;
	lip white, wide dark burgundy band distally, bugundy spots side lobes;
	column white overlaid burgundy, ventral surface

	spotted burgundy, anther cap cream;

	substance firm; texture matte.
